3e\u0433\u043e \u043d\u0430\u0441\u043b\u0435\u0434\u0438\u044f (\u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0430 \u0438\u0441\u0442\u043e\u0440\u0438\u0438                  \u0438 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b) \u043d\u0430\u0440\u043e\u0434\u043e\u0432 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438 \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f  \u00ab\u0413\u043e\u0441\u0442\u0438\u043d\u044b\u0439 \u0434\u0432\u043e\u0440\u00bb, 1680 \u0433., \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u043e \u0430\u0434\u0440\u0435\u0441\u0443: \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u043e \u0430\u0434\u0440\u0435\u0441\u0443: \u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c, \u0433. \u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a, \u041d\u0430\u0431\u0435\u0440\u0435\u0436\u043d\u0430\u044f \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0414\u0432\u0438\u043d\u044b, \u0434. 85/86, \u041d\u0430\u0431\u0435\u0440\u0435\u0436\u043d\u0430\u044f \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0414\u0432\u0438\u043d\u044b, \u0434. 86, \u043a\u043e\u0440\u043f. 1    \u0413\u0440\u0430\u0434\u043e\u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0441\u0442\u0438\u043a\u0438 \u043e\u0431\u044a\u0435\u043a\u0442\u0430 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u043e\u0433\u043e \u043d\u0430\u0441\u043b\u0435\u0434\u0438\u044f (\u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u0430 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0438 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b) \u043d\u0430\u0440\u043e\u0434\u043e\u0432 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438 \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u00ab\u0413\u043e\u0441\u0442\u0438\u043d\u044b\u0439 \u0434\u0432\u043e\u0440\u00bb (\u0434\u0430\u043b\u0435\u0435 \u2013 \u0413\u043e\u0441\u0442\u0438\u043d\u044b\u0439 \u0434\u0432\u043e\u0440)    \u041c\u0435\u0441\u0442\u043e\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u0438 \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u0440\u043e\u043b\u044c \u0413\u043e\u0441\u0442\u0438\u043d\u043e\u0433\u043e \u0434\u0432\u043e\u0440\u0430 \u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 \u043e\u043a\u0440\u0443\u0436\u0430\u044e\u0449\u0435\u0433\u043e \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0438 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u043e\u0433\u043e \u043b\u0430\u043d\u0434\u0448\u0430\u0444\u0442\u0430 \u0433\u043e\u0440\u043e\u0434\u0430 \u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u043a\u0430.  \u0421\u0435\u043a\u0442\u043e\u0440\u044b \u0438 \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0432\u0438\u0434\u043e\u0432\u044b\u0445 \u0440\u0430\u0441\u043a\u0440\u044b\u0442\u0438\u0439, \u0432\u0438\u0437\u0443\u0430\u043b\u044c\u043d\u044b\u0435 \u0441\u0432\u044f\u0437\u0438 \u0413\u043e\u0441\u0442\u0438\u043d\u043e\u0433\u043e \u0434\u0432\u043e\u0440\u0430.    \u041e\u0431\u044a\u0435\u043c\u043d\u043e-\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0435 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0441\u0442\u0438\u043a\u0438    \u041a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0430 \u0413\u043e\u0441\u0442\u0438\u043d\u043e\u0433\u043e \u0434\u0432\u043e\u0440\u0430, \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u0441\u043e\u0432\u043e\u043a\u0443\u043f\u043d\u043e\u0441\u0442\u044c\u044e \u0438 \u0432\u0437\u0430\u0438\u043c\u043e\u0441\u0432\u044f\u0437\u044c\u044e \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0445 \u043f\u043e \u0434\u0430\u0442\u0435 \u043f\u043e\u0441\u0442\u0440\u043e\u0439\u043a\u0438                                                  \u0438 \u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u043c\u0443 \u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u043c\u0443 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044e \u0437\u0434\u0430\u043d\u0438\u0439 \u0433\u043b\u0430\u0432\u043d\u043e\u0433\u043e \u043a\u043e\u0440\u043f\u0443\u0441\u0430 XVII \u0432\u0435\u043a\u0430; \u0431\u0438\u0440\u0436\u0438 1787\u20131789 \u0433\u0433. \u0441 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0431\u0430\u0448\u043d\u0435\u0439 1792 \u0433.; \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0431\u0430\u0448\u043d\u0438 1789\u20131790 \u0433\u0433.; \u0432\u0438\u043d\u043d\u044b\u0445 \u0438 \u0441\u043e\u043b\u044f\u043d\u044b\u0445 \u043c\u0430\u0433\u0430\u0437\u0438\u043d\u043e\u0432 1788\u20131792 \u0433\u0433.; \u0432\u0438\u043d\u043d\u044b\u0445 \u0438 \u0441\u043e\u043b\u044f\u043d\u044b\u0445 \u0441\u043a\u043b\u0430\u0434\u043e\u0432 \u043a\u043e\u043d\u0446\u0430 XVIII\u2013\u043d\u0430\u0447\u0430\u043b\u0430 XIX \u0432\u0432.  \u041f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e-\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u043e\u0447\u043d\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0413\u043e\u0441\u0442\u0438\u043d\u043e\u0433\u043e \u0434\u0432\u043e\u0440\u0430 \u043d\u0430\u0447\u0430\u043b\u0430 XIX \u0432\u0435\u043a\u0430, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0430\u044f \u0441\u043e\u0431\u043e\u0439 \u043f\u0440\u043e\u0442\u044f\u0436\u0435\u043d\u043d\u044b\u0439, \u0432\u044b\u0442\u044f\u043d\u0443\u0442\u044b\u0439 \u043f\u043e \u043e\u0441\u0438 \u0441\u0435\u0432\u0435\u0440-\u044e\u0433 \u043e\u0431\u044a\u0435\u043c, \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0449\u0438\u0439 \u0433\u043b\u0430\u0432\u043d\u044b\u0439 \u043a\u043e\u0440\u043f\u0443\u0441 (\u044e\u0436\u043d\u043e\u0435 \u043a\u0440\u044b\u043b\u043e), \u0432\u0438\u043d\u043d\u044b\u0435 \u0438 \u0441\u043e\u043b\u044f\u043d\u044b\u0435 \u043c\u0430\u0433\u0430\u0437\u0438\u043d\u044b \u0441 \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0431\u0430\u0448\u043d\u0435\u0439 (\u0441\u0435\u0432\u0435\u0440\u043d\u043e\u0435 \u043a\u0440\u044b\u043b\u043e) \u0438 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u0443\u044e \u043d\u0430 \u0441\u0442\u044b\u043a\u0435 \u043a\u043e\u0440\u043f\u0443\u0441\u043e\u0432 \u0431\u0438\u0440\u0436\u0443 \u0441 \u0431\u0430\u0448\u043d\u0435\u0439; \u043a \u0441\u0435\u0432\u0435\u0440\u043e-\u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u043c\u0443 \u0443\u0433\u043b\u0443 \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u043a\u0440\u044b\u043b\u0430 \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0431\u0430\u0448\u043d\u0438 \u043f\u0440\u0438\u043c\u044b\u043a\u0430\u0435\u0442 \u043e\u0440\u0438\u0435\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u0441 \u0432\u043e\u0441\u0442\u043e\u043a\u0430 \u043d\u0430 \u0437\u0430\u043f\u0430\u0434 \u043e\u0431\u044a\u0435\u043c \u0432\u0438\u043d\u043d\u044b\u0445 \u0438 \u0441\u043e\u043b\u044f\u043d\u044b\u0445 \u0441\u043a\u043b\u0430\u0434\u043e\u0432.    \u0410\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u044b\u0435 \u0438 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0442\u0438\u0432\u043d\u044b\u0435 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0441\u0442\u0438\u043a\u0438    \u041e\u0431\u044a\u0435\u043c\u043d\u043e-\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u044f \u0433\u043b\u0430\u0432\u043d\u043e\u0433\u043e \u043a\u043e\u0440\u043f\u0443\u0441\u0430 \u0413\u043e\u0441\u0442\u0438\u043d\u043e\u0433\u043e \u0434\u0432\u043e\u0440\u0430 \u043a\u043e\u043d\u0446\u0430 XVII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XVIII, XIX \u0432\u0435\u043a\u043e\u0432, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438, \u0433\u0430\u0431\u0430\u0440\u0438\u0442\u044b \u043e\u0431\u044a\u0435\u043c\u043e\u0432, \u043a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u044e, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0430\u044f \u0441\u043e\u0431\u043e\u0439 \u0434\u0432\u0443\u0445\u044d\u0442\u0430\u0436\u043d\u044b\u0439, \u043f\u0440\u044f\u043c\u043e\u0443\u0433\u043e\u043b\u044c\u043d\u044b\u0439 \u0432 \u043f\u043b\u0430\u043d\u0435 \u043e\u0431\u044a\u0435\u043c                                  \u0441 \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u043c\u0438 \u043d\u0430 \u0444\u043b\u0430\u043d\u0433\u0430\u0445 \u043f\u043e \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u043c\u0443 \u0444\u0430\u0441\u0430\u0434\u0443 \u0438 \u0441\u043a\u0440\u0443\u0433\u043b\u0435\u043d\u043d\u044b\u043c \u044e\u0433\u043e-\u0437\u0430\u043f\u0430\u0434\u043d\u044b\u043c \u0443\u0433\u043b\u043e\u043c.  \u0421\u043a\u0430\u0442\u043d\u044b\u0435 \u043a\u0440\u044b\u0448\u0438 \u043a\u043e\u0440\u043f\u0443\u0441\u0430, \u0438\u0445 \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438, \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u044f, \u043a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u044f, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043a\u0440\u043e\u0432\u0435\u043b\u044c\u043d\u044b\u0445 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0439 \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XVIII, XIX \u0432\u0435\u043a\u043e\u0432.  \u041a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0438 \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e-\u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0435 \u0444\u0430\u0441\u0430\u0434\u043e\u0432 \u043a\u043e\u043d\u0446\u0430 XVII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XVIII, XIX \u0432\u0435\u043a\u043e\u0432, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u043c\u0435\u0441\u0442\u043e\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435, \u0444\u043e\u0440\u043c\u0430, \u0440\u0430\u0437\u043c\u0435\u0440 \u0438 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0435 \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432: \u0441\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0447\u0430\u0441\u0442\u044c \u0437\u0430\u043f\u0430\u0434\u043d\u043e\u0433\u043e \u0444\u0430\u0441\u0430\u0434\u0430 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u0430\u043d\u0430 \u043a\u0432\u0430\u0434\u0440\u043e\u0432\u044b\u043c \u0440\u0443\u0441\u0442\u043e\u043c, \u0440\u0430\u0432\u043d\u043e\u043c\u0435\u0440\u043d\u043e \u043f\u0440\u043e\u0440\u0435\u0437\u0430\u043d\u0430 \u043f\u0440\u044f\u043c\u043e\u0443\u0433\u043e\u043b\u044c\u043d\u044b\u043c\u0438 \u043e\u043a\u043d\u0430\u043c\u0438 \u0432 \u043d\u0438\u0436\u043d\u0435\u043c \u044d\u0442\u0430\u0436\u0435, \u0430\u0440\u043e\u0447\u043d\u044b\u043c\u0438 \u0432 \u043f\u0440\u043e\u0444\u0438\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0445 \u043d\u0430\u043b\u0438\u0447\u043d\u0438\u043a\u0430\u0445 \u0441 \u0437\u0430\u043c\u043a\u043e\u0432\u044b\u043c \u043a\u0430\u043c\u043d\u0435\u043c \u2013 \u0432\u043e \u0432\u0442\u043e\u0440\u043e\u043c; \u0446\u0435\u043d\u0442\u0440 \u0444\u0430\u0441\u0430\u0434\u0430 \u0432\u044b\u0434\u0435\u043b\u0435\u043d \u043f\u0440\u043e\u0435\u0437\u0434\u043d\u043e\u0439 \u0430\u0440\u043a\u043e\u0439, \u043e\u0431\u0440\u0430\u043c\u043b\u0435\u043d\u043d\u043e\u0439 \u043b\u043e\u043f\u0430\u0442\u043a\u0430\u043c\u0438 \u0438\u0437 \u043a\u0432\u0430\u0434\u0440\u043e\u0432\u044b\u0445 \u0448\u0438\u0440\u0438\u043d\u043e\u043a; \u043d\u0430\u0434 \u0430\u0440\u043a\u043e\u0439 \u2013 \u0441\u0442\u0443\u043f\u0435\u043d\u0447\u0430\u0442\u044b\u0439 \u0430\u0442\u0442\u0438\u043a; \u043c\u0435\u0436\u0434\u0443\u044d\u0442\u0430\u0436\u043d\u044b\u0439 \u0438 \u0432\u0435\u043d\u0447\u0430\u044e\u0449\u0438\u0439 \u043a\u0430\u0440\u043d\u0438\u0437\u044b \u043f\u0440\u043e\u0444\u0438\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0435; \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u044b\u0439 \u0444\u0430\u0441\u0430\u0434 \u0432 \u043d\u0438\u0436\u043d\u0435\u043c \u044d\u0442\u0430\u0436\u0435 \u043f\u0440\u043e\u0440\u0435\u0437\u0430\u043d \u0430\u0440\u043e\u0447\u043d\u044b\u043c\u0438 \u0430\u043c\u0431\u0440\u0430\u0437\u0443\u0440\u0430\u043c\u0438 \u043e\u043a\u043e\u043d; \u0432 \u0432\u0435\u0440\u0445\u043d\u0435\u043c \u044d\u0442\u0430\u0436\u0435, \u043e\u0442\u0434\u0435\u043b\u0451\u043d\u043d\u043e\u043c \u043f\u043e\u044f\u0441\u043e\u043c \u043f\u0435\u0440\u0441\u043f\u0435\u043a\u0442\u0438\u0432\u043d\u044b\u0445 \u0448\u0438\u0440\u0438\u043d\u043e\u043a, \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0442 \u0430\u0440\u043a\u0430\u0434\u0430 \u0433\u0430\u043b\u0435\u0440\u0435\u0438 \u0432 \u043c\u043d\u043e\u0433\u043e\u043f\u0440\u043e\u0444\u0438\u043b\u044c\u043d\u043e\u043c \u043e\u0431\u0440\u0430\u043c\u043b\u0435\u043d\u0438\u0438; \u0447\u0430\u0441\u0442\u044c \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u0432\u044b\u0441\u0442\u0443\u043f\u0430 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0430 \u0430\u043d\u0430\u043b\u043e\u0433\u0438\u0447\u043d\u043e\u0439 \u0430\u0440\u043a\u0430\u0434\u043e\u0439; \u043f\u0440\u043e\u0435\u043c \u043f\u0440\u043e\u0435\u0437\u0434\u043d\u043e\u0439 \u0430\u0440\u043a\u0438 \u043e\u0431\u0440\u0430\u043c\u043b\u0435\u043d \u043f\u043e\u044f\u0441\u043e\u043c \u043f\u043e\u0440\u0435\u0431\u0440\u0438\u043a\u0430, \u0444\u043b\u0430\u043d\u043a\u0438\u0440\u043e\u0432\u0430\u043d \u043b\u043e\u043f\u0430\u0442\u043a\u0430\u043c\u0438                                \u0441 \u0448\u0438\u0440\u0438\u043d\u043a\u0430\u043c\u0438; \u043f\u043b\u043e\u0441\u043a\u043e\u0441\u0442\u0438 \u0441\u0442\u0435\u043d \u044e\u0436\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 \u043a\u043e\u0440\u043f\u0443\u0441\u0430 \u0433\u043b\u0430\u0434\u043a\u0438\u0435, \u0447\u043b\u0435\u043d\u044f\u0442\u0441\u044f \u043c\u0435\u0436\u0434\u0443\u044d\u0442\u0430\u0436\u043d\u044b\u043c \u0438 \u0432\u0435\u043d\u0447\u0430\u044e\u0449\u0438\u043c \u043a\u0430\u0440\u043d\u0438\u0437\u0430\u043c\u0438; \u0430\u0440\u043e\u0447\u043d\u044b\u0435 \u043e\u043a\u043d\u0430 \u0432\u043e \u0432\u0442\u043e\u0440\u043e\u043c \u044d\u0442\u0430\u0436\u0435 \u043e\u0431\u0440\u0430\u043c\u043b\u0435\u043d\u044b \u043d\u0430\u043b\u0438\u0447\u043d\u0438\u043a\u0430\u043c\u0438 \u0441 \u043a\u0438\u043b\u0435\u0432\u0438\u0434\u043d\u044b\u043c\u0438 \u043a\u043e\u043a\u043e\u0448\u043d\u0438\u043a\u0430\u043c\u0438, \u043d\u0430\u0431\u0440\u0430\u043d\u043d\u044b\u043c\u0438                               \u0438\u0437 \u0432\u0430\u043b\u0438\u043a\u043e\u0432 \u0438 \u043f\u043e\u043b\u043e\u0447\u0435\u043a.  \u041c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0438 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043e\u0442\u0434\u0435\u043b\u043a\u0438 \u0444\u0430\u0441\u0430\u0434\u043d\u044b\u0445 \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u0435\u0439 \u043a\u043e\u043d\u0446\u0430 XVII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XVIII, XIX \u0432\u0435\u043a\u043e\u0432, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u0441\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0435                    \u0438\u0437 \u043a\u0438\u0440\u043f\u0438\u0447\u0430 \u0441\u0442\u0435\u043d\u044b \u043d\u0430 \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u043e\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438; \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u044b\u0435 \u0432 \u043a\u0438\u0440\u043f\u0438\u0447\u0435                            \u0438 \u0448\u0442\u0443\u043a\u0430\u0442\u0443\u0440\u043a\u0435 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u044b \u0444\u0430\u0441\u0430\u0434\u043d\u043e\u0433\u043e \u0434\u0435\u043a\u043e\u0440\u0430.  \u041a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0444\u0430\u0441\u0430\u0434\u043e\u0432, \u043a\u0440\u043e\u0432\u0435\u043b\u044c.  \u041f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e-\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u043e\u0447\u043d\u0430\u044f \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0430 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432 \u0432 \u043f\u0440\u0435\u0434\u0435\u043b\u0430\u0445 \u043a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0445 \u0441\u0442\u0435\u043d, \u0441\u0442\u043e\u043b\u0431\u043e\u0432 \u0438 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u0438\u0439 \u043a\u043e\u043d\u0446\u0430 XVII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XVIII, XIX \u0432\u0435\u043a\u043e\u0432, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435, \u0444\u043e\u0440\u043c\u0430                       \u0438 \u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432.   \u041a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0435 \u043a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0435 \u0441\u0442\u0435\u043d\u044b \u0438 \u0441\u0442\u043e\u043b\u0431\u044b \u043d\u0430 \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u043e\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438; \u043a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0435 \u0430\u0440\u043a\u0438 \u0438 \u0441\u0432\u043e\u0434\u044b \u0441 \u0440\u0430\u0441\u043f\u0430\u043b\u0443\u0431\u043a\u0430\u043c\u0438; \u043f\u043b\u043e\u0441\u043a\u0438\u0435 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u0438\u044f;                                           \u0438\u0445 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 \u0438 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b, \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438 \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XVIII, XIX \u0432\u0435\u043a\u043e\u0432.  \u0421\u0442\u043e\u043b\u044f\u0440\u043d\u044b\u0435 \u0437\u0430\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u044f \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432 \u0441\u043e \u0441\u043a\u043e\u0431\u044f\u043d\u044b\u043c \u043f\u0440\u0438\u0431\u043e\u0440\u043e\u043c, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u0438\u0445 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u044f, \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0438 \u043a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435                      \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XVIII, XIX \u0432\u0435\u043a\u043e\u0432.  \u0421\u043a\u043e\u0431\u044f\u043d\u044b\u0435 \u0438\u0437\u0434\u0435\u043b\u0438\u044f \u043a\u043e\u043d\u0446\u0430 XVII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XVIII, XIX \u0432\u0435\u043a\u043e\u0432, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u043c\u0435\u0442\u0430\u043b\u043b\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043f\u043e\u0434\u0441\u0442\u0430\u0432\u044b, \u043a\u043e\u0432\u0430\u043d\u044b\u0435 \u0437\u0430\u0442\u044f\u0436\u043a\u0438 \u0430\u0440\u043e\u043a                      \u0438 \u0441\u0432\u043e\u0434\u043e\u0432, \u0441\u0432\u044f\u0437\u0438, \u043a\u043e\u0432\u0430\u043d\u044b\u0435 \u0440\u0435\u0448\u0435\u0442\u043a\u0438 \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432.  \u042d\u043b\u0435\u043c\u0435\u043d\u0442\u044b \u0434\u0435\u043a\u043e\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0433\u043e \u0443\u0431\u0440\u0430\u043d\u0441\u0442\u0432\u0430 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432 \u043a\u043e\u043d\u0446\u0430 XVII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XVIII, XIX \u0432\u0435\u043a\u043e\u0432, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u043f\u0440\u043e\u0444\u0438\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u0442\u044f\u0433\u0438, \u043a\u0430\u0440\u043d\u0438\u0437\u044b, \u043e\u0431\u0440\u0430\u043c\u043b\u0435\u043d\u0438\u044f \u043f\u0440\u043e\u0435\u043c\u043e\u0432 \u0438 \u043d\u0438\u0448.   \u041a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432.    \u041e\u0431\u044a\u0435\u043c\u043d\u043e-\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u044f \u0432\u0438\u043d\u043d\u044b\u0445 \u0438 \u0441\u043e\u043b\u044f\u043d\u044b\u0445 \u043c\u0430\u0433\u0430\u0437\u0438\u043d\u043e\u0432 \u0413\u043e\u0441\u0442\u0438\u043d\u043e\u0433\u043e \u0434\u0432\u043e\u0440\u0430 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438                         XIX \u0432\u0435\u043a\u0430, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438, \u0433\u0430\u0431\u0430\u0440\u0438\u0442\u044b \u043e\u0431\u044a\u0435\u043c\u043e\u0432, \u043a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u044e, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0430\u044f \u0441\u043e\u0431\u043e\u0439 \u0434\u0432\u0443\u0445\u044d\u0442\u0430\u0436\u043d\u044b\u0439, \u043f\u0440\u044f\u043c\u043e\u0443\u0433\u043e\u043b\u044c\u043d\u044b\u0439 \u0432 \u043f\u043b\u0430\u043d\u0435 \u043e\u0431\u044a\u0435\u043c.  \u0421\u043a\u0430\u0442\u043d\u044b\u0435 \u043a\u0440\u044b\u0448\u0438 \u043a\u043e\u0440\u043f\u0443\u0441\u0430 \u0432\u0438\u043d\u043d\u044b\u0445 \u0438 \u0441\u043e\u043b\u044f\u043d\u044b\u0445 \u043c\u0430\u0433\u0430\u0437\u0438\u043d\u043e\u0432, \u0438\u0445 \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438, \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u044f, \u043a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u044f, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043a\u0440\u043e\u0432\u0435\u043b\u044c\u043d\u044b\u0445 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0439                           \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430.  \u041a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0438 \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e-\u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0435 \u0444\u0430\u0441\u0430\u0434\u043e\u0432 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430,                            \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u043c\u0435\u0441\u0442\u043e\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435, \u0444\u043e\u0440\u043c\u0430, \u0440\u0430\u0437\u043c\u0435\u0440 \u0438 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0435 \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432: \u0437\u0430\u043f\u0430\u0434\u043d\u044b\u0439 \u0444\u0430\u0441\u0430\u0434 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u0430\u043d \u043a\u0432\u0430\u0434\u0440\u043e\u0432\u044b\u043c \u0440\u0443\u0441\u0442\u043e\u043c, \u0440\u0430\u0432\u043d\u043e\u043c\u0435\u0440\u043d\u043e \u043f\u0440\u043e\u0440\u0435\u0437\u0430\u043d \u043f\u0440\u044f\u043c\u043e\u0443\u0433\u043e\u043b\u044c\u043d\u044b\u043c\u0438 \u043e\u043a\u043d\u0430\u043c\u0438 \u0432 \u043d\u0438\u0436\u043d\u0435\u043c \u044d\u0442\u0430\u0436\u0435, \u0430\u0440\u043e\u0447\u043d\u044b\u043c\u0438 \u0432 \u043f\u0440\u043e\u0444\u0438\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0445 \u043d\u0430\u043b\u0438\u0447\u043d\u0438\u043a\u0430\u0445 \u0441 \u0437\u0430\u043c\u043a\u043e\u0432\u044b\u043c \u043a\u0430\u043c\u043d\u0435\u043c \u2013 \u0432\u043e \u0432\u0442\u043e\u0440\u043e\u043c; \u0446\u0435\u043d\u0442\u0440 \u0444\u0430\u0441\u0430\u0434\u0430 \u0432\u044b\u0434\u0435\u043b\u0435\u043d \u043f\u0440\u043e\u0435\u0437\u0434\u043d\u043e\u0439 \u0430\u0440\u043a\u043e\u0439, \u043e\u0431\u0440\u0430\u043c\u043b\u0435\u043d\u043d\u043e\u0439 \u043b\u043e\u043f\u0430\u0442\u043a\u0430\u043c\u0438 \u0438\u0437 \u043a\u0432\u0430\u0434\u0440\u043e\u0432\u044b\u0445 \u0448\u0438\u0440\u0438\u043d\u043e\u043a; \u043d\u0430\u0434 \u0430\u0440\u043a\u043e\u0439 \u2013 \u0441\u0442\u0443\u043f\u0435\u043d\u0447\u0430\u0442\u044b\u0439 \u0430\u0442\u0442\u0438\u043a; \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u0447\u0430\u0441\u0442\u044c \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0433\u043e \u0444\u0430\u0441\u0430\u0434\u0430 \u0432\u044b\u0434\u0435\u043b\u0435\u043d\u0430 \u0440\u0438\u0437\u0430\u043b\u0438\u0442\u043e\u043c \u0441 \u0442\u0440\u0435\u0445\u0447\u0430\u0441\u0442\u043d\u044b\u043c \u043e\u043a\u043d\u043e\u043c; \u043c\u0435\u0436\u0434\u0443\u044d\u0442\u0430\u0436\u043d\u044b\u0439 \u0438 \u0432\u0435\u043d\u0447\u0430\u044e\u0449\u0438\u0439 \u043a\u0430\u0440\u043d\u0438\u0437\u044b \u043f\u0440\u043e\u0444\u0438\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0435.  \u041c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0438 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043e\u0442\u0434\u0435\u043b\u043a\u0438 \u0444\u0430\u0441\u0430\u0434\u043d\u044b\u0445 \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u0435\u0439 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u0441\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0435 \u0438\u0437 \u043a\u0438\u0440\u043f\u0438\u0447\u0430 \u0441\u0442\u0435\u043d\u044b \u043d\u0430 \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u043e\u043c \u0446\u043e\u043a\u043e\u043b\u0435; \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u044b\u0435 \u0432 \u043a\u0438\u0440\u043f\u0438\u0447\u0435 \u0438 \u0448\u0442\u0443\u043a\u0430\u0442\u0443\u0440\u043a\u0435 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u044b \u0444\u0430\u0441\u0430\u0434\u043d\u043e\u0433\u043e \u0434\u0435\u043a\u043e\u0440\u0430.  \u041a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0444\u0430\u0441\u0430\u0434\u043e\u0432, \u043a\u0440\u043e\u0432\u0435\u043b\u044c.  \u041f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e-\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u043e\u0447\u043d\u0430\u044f \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0430 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432 \u0432 \u043f\u0440\u0435\u0434\u0435\u043b\u0430\u0445 \u043a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0445 \u0441\u0442\u0435\u043d \u0438 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u0438\u0439 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f                           \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435, \u0444\u043e\u0440\u043c\u0430 \u0438 \u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432.   \u041a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0435 \u043a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0435 \u0441\u0442\u0435\u043d\u044b \u043d\u0430 \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u043e\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438; \u043a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0435 \u0430\u0440\u043a\u0438 \u0438 \u0441\u0432\u043e\u0434\u044b \u0441 \u0440\u0430\u0441\u043f\u0430\u043b\u0443\u0431\u043a\u0430\u043c\u0438; \u043f\u043b\u043e\u0441\u043a\u0438\u0435 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u0438\u044f; \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u044b\u0435 \u043b\u0435\u0441\u0442\u043d\u0438\u0446\u044b; \u0438\u0445 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 \u0438 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b, \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438 \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430.  \u0421\u0442\u043e\u043b\u044f\u0440\u043d\u044b\u0435 \u0437\u0430\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u044f \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432 \u0441\u043e \u0441\u043a\u043e\u0431\u044f\u043d\u044b\u043c \u043f\u0440\u0438\u0431\u043e\u0440\u043e\u043c, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u0438\u0445 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u044f, \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0438 \u043a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435                     \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430.  \u0421\u043a\u043e\u0431\u044f\u043d\u044b\u0435 \u0438\u0437\u0434\u0435\u043b\u0438\u044f \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u043c\u0435\u0442\u0430\u043b\u043b\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043f\u043e\u0434\u0441\u0442\u0430\u0432\u044b, \u043a\u043e\u0432\u0430\u043d\u044b\u0435 \u0437\u0430\u0442\u044f\u0436\u043a\u0438 \u0430\u0440\u043e\u043a \u0438 \u0441\u0432\u043e\u0434\u043e\u0432, \u0441\u0432\u044f\u0437\u0438, \u043a\u043e\u0432\u0430\u043d\u044b\u0435 \u0440\u0435\u0448\u0435\u0442\u043a\u0438 \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432.   \u041a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432.    \u041e\u0431\u044a\u0435\u043c\u043d\u043e-\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u044f \u0431\u0438\u0440\u0436\u0438 \u0441 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0431\u0430\u0448\u043d\u0435\u0439 \u0413\u043e\u0441\u0442\u0438\u043d\u043e\u0433\u043e \u0434\u0432\u043e\u0440\u0430 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438                       XIX \u0432\u0435\u043a\u0430, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438, \u0433\u0430\u0431\u0430\u0440\u0438\u0442\u044b \u043e\u0431\u044a\u0435\u043c\u043e\u0432, \u043a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u044e, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0430\u044f \u0441\u043e\u0431\u043e\u0439 \u043e\u0434\u043d\u043e\u044d\u0442\u0430\u0436\u043d\u044b\u0439, \u043f\u0440\u044f\u043c\u043e\u0443\u0433\u043e\u043b\u044c\u043d\u043e\u0439 \u0432 \u043f\u043b\u0430\u043d\u0435 \u043e\u0431\u044a\u0435\u043c; \u043f\u043e\u0437\u0430\u0434\u0438 \u0431\u0438\u0440\u0436\u0438 \u043d\u0430 \u0441\u0442\u044b\u043a\u0435 \u0413\u043b\u0430\u0432\u043d\u043e\u0433\u043e \u043a\u043e\u0440\u043f\u0443\u0441\u0430 \u0438 \u0432\u0438\u043d\u043d\u044b\u0445 \u0438 \u0441\u043e\u043b\u044f\u043d\u044b\u0445 \u043c\u0430\u0433\u0430\u0437\u0438\u043d\u043e\u0432 \u0432\u043e\u0437\u0432\u044b\u0448\u0430\u0435\u0442\u0441\u044f \u0432\u043e\u0441\u044c\u043c\u0438\u0433\u0440\u0430\u043d\u043d\u044b\u0439 \u044f\u0440\u0443\u0441 \u0431\u0430\u0448\u043d\u0438.  \u0421\u043a\u0430\u0442\u043d\u044b\u0435 \u043a\u0440\u044b\u0448\u0438 \u0437\u0434\u0430\u043d\u0438\u044f, \u0438\u0445 \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438, \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u044f, \u043a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u044f, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043a\u0440\u043e\u0432\u0435\u043b\u044c\u043d\u044b\u0445 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0439 \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430.  \u0417\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0438\u0435 \u0431\u0430\u0448\u043d\u0438 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u043e\u0435 \u0432 \u0432\u0438\u0434\u0435 \u0432\u043e\u0441\u044c\u043c\u0438\u0433\u0440\u0430\u043d\u043d\u043e\u0433\u043e \u043a\u0443\u043f\u043e\u043b\u0430, \u0443\u0432\u0435\u043d\u0447\u0430\u043d\u043d\u043e\u0433\u043e \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u0438\u043c \u043f\u043e\u043b\u0443\u0441\u0444\u0435\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u043a\u0443\u043f\u043e\u043b\u043e\u043c \u0441\u043e \u0448\u043f\u0438\u043b\u0435\u043c \u043d\u0430 \u043a\u0440\u0443\u0433\u043b\u043e\u043c \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u0435,                         \u0438\u0445 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438, \u0433\u0430\u0431\u0430\u0440\u0438\u0442\u044b, \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0439.  \u041a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0438 \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e-\u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0435 \u0444\u0430\u0441\u0430\u0434\u043e\u0432 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u043c\u0435\u0441\u0442\u043e\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435, \u0444\u043e\u0440\u043c\u0430, \u0440\u0430\u0437\u043c\u0435\u0440 \u0438 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0435 \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432: \u0432\u044b\u0441\u043e\u043a\u0438\u0435 \u0430\u0440\u043e\u0447\u043d\u044b\u0435 \u043f\u0440\u043e\u0435\u043c\u044b \u043d\u0430 \u0444\u0430\u0441\u0430\u0434\u0430\u0445 \u0411\u0438\u0440\u0436\u0438 \u0444\u043b\u0430\u043d\u043a\u0438\u0440\u043e\u0432\u0430\u043d\u044b \u0441\u043f\u0430\u0440\u0435\u043d\u043d\u044b\u043c\u0438 \u0442\u043e\u0441\u043a\u0430\u043d\u0441\u043a\u0438\u043c\u0438 \u043f\u043e\u043b\u0443\u043a\u043e\u043b\u043e\u043d\u043d\u0430\u043c\u0438, \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u044e\u0449\u0438\u043c\u0438 \u0448\u0438\u0440\u043e\u043a\u0438\u0439 \u0430\u043d\u0442\u0430\u0431\u043b\u0435\u043c\u0435\u043d\u0442; \u0430\u0440\u0445\u0438\u0432\u043e\u043b\u044c\u0442\u044b \u043f\u0440\u043e\u0435\u043c\u043e\u0432 \u0441 \u0437\u0430\u043c\u043a\u043e\u0432\u044b\u043c \u043a\u0430\u043c\u043d\u0435\u043c; \u0437\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0433\u0440\u0430\u043d\u044c \u0432\u043e\u0441\u044c\u043c\u0438\u0433\u0440\u0430\u043d\u043d\u0438\u043a\u0430 \u0431\u0430\u0448\u043d\u0438, \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0444\u0438\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u043c \u043a\u0430\u0440\u043d\u0438\u0437\u043e\u043c, \u0434\u0435\u043a\u043e\u0440\u0438\u0440\u043e\u0432\u0430\u043d\u0430 \u043f\u043e\u043b\u0443\u0446\u0438\u0440\u043a\u0443\u043b\u044c\u043d\u044b\u043c \u0430\u0440\u0445\u0438\u0432\u043e\u043b\u044c\u0442\u043e\u043c, \u0434\u0438\u0430\u0433\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0435 \u0433\u0440\u0430\u043d\u0438 \u043f\u0440\u043e\u0440\u0435\u0437\u0430\u043d\u044b \u043a\u0440\u0443\u0433\u043b\u044b\u043c\u0438 \u043e\u043a\u043d\u0430\u043c\u0438.  \u041c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0438 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043e\u0442\u0434\u0435\u043b\u043a\u0438 \u0444\u0430\u0441\u0430\u0434\u043d\u044b\u0445 \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u0435\u0439 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0432\u043a\u043b\u044e\u0447\u0430\u044f, \u0441\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0435 \u0438\u0437 \u043a\u0438\u0440\u043f\u0438\u0447\u0430 \u0441\u0442\u0435\u043d\u044b \u0431\u0438\u0440\u0436\u0438 \u043d\u0430 \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u043e\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438; \u043a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0435 \u0441\u0442\u0435\u043d\u044b \u0431\u0430\u0448\u043d\u0438; \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u044b\u0435 \u0432 \u043a\u0438\u0440\u043f\u0438\u0447\u0435 \u0438 \u0448\u0442\u0443\u043a\u0430\u0442\u0443\u0440\u043a\u0435 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u044b \u0444\u0430\u0441\u0430\u0434\u043d\u043e\u0433\u043e \u0434\u0435\u043a\u043e\u0440\u0430.  \u041a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0444\u0430\u0441\u0430\u0434\u043e\u0432, \u043a\u0440\u043e\u0432\u0435\u043b\u044c.  \u041f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e-\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u043e\u0447\u043d\u0430\u044f \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0430 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432 \u0431\u0438\u0440\u0436\u0438                                   \u0432 \u043f\u0440\u0435\u0434\u0435\u043b\u0430\u0445 \u043a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0445 \u0441\u0442\u0435\u043d \u0438 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u0438\u0439 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0441\u043e\u0441\u0442\u043e\u044f\u0449\u0430\u044f \u0438\u0437 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0437\u0430\u043b\u0430, \u0444\u043b\u0430\u043d\u043a\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0433\u043e \u0443\u0437\u043a\u0438\u043c\u0438 \u043f\u043e\u043c\u0435\u0449\u0435\u043d\u0438\u044f\u043c\u0438 \u0441 \u044d\u043a\u0441\u0435\u0434\u0440\u0430\u043c\u0438 \u0432 \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u044b\u0445 \u0442\u043e\u0440\u0446\u0430\u0445,                       \u0430 \u0442\u0430\u043a\u0436\u0435 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435, \u0444\u043e\u0440\u043c\u0430 \u0438 \u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432.    \u041f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e-\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u043e\u0447\u043d\u0430\u044f \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0430 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0431\u0430\u0448\u043d\u0438 \u0432 \u043f\u0440\u0435\u0434\u0435\u043b\u0430\u0445 \u043a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0445 \u0441\u0442\u0435\u043d \u0438 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u0438\u0439 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0430\u044f \u0441\u043e\u0431\u043e\u0439 \u0435\u0434\u0438\u043d\u043e\u0435 \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u043e, \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u044e\u0449\u0435\u0435\u0441\u044f \u043f\u043e\u0434 \u043a\u0443\u043f\u043e\u043b, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435, \u0444\u043e\u0440\u043c\u0430                            \u0438 \u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432.  \u041a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0435 \u043a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0435 \u0441\u0442\u0435\u043d\u044b \u0431\u0438\u0440\u0436\u0438 \u043d\u0430 \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u043e\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438; \u043a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0435 \u043a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0435 \u0441\u0442\u0435\u043d\u044b \u0431\u0430\u0448\u043d\u0438; \u043f\u043b\u043e\u0441\u043a\u0438\u0435 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u0438\u044f; \u0438\u0445 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438        \u0438 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b, \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438 \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f                          \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430.  \u0421\u0442\u043e\u043b\u044f\u0440\u043d\u044b\u0435 \u0437\u0430\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u044f \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432 \u0441\u043e \u0441\u043a\u043e\u0431\u044f\u043d\u044b\u043c \u043f\u0440\u0438\u0431\u043e\u0440\u043e\u043c, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u0438\u0445 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u044f, \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0438 \u043a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435                    \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430.  \u042d\u043b\u0435\u043c\u0435\u043d\u0442\u044b \u0434\u0435\u043a\u043e\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0433\u043e \u0443\u0431\u0440\u0430\u043d\u0441\u0442\u0432\u0430 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u043f\u0440\u043e\u0444\u0438\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u0442\u044f\u0433\u0438, \u043a\u0430\u0440\u043d\u0438\u0437\u044b, \u043e\u0431\u0440\u0430\u043c\u043b\u0435\u043d\u0438\u044f \u043f\u0440\u043e\u0435\u043c\u043e\u0432 \u0438 \u043d\u0438\u0448; \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u0432 \u0434\u0435\u043a\u043e\u0440\u0435 \u0441\u0442\u0435\u043d \u0431\u0438\u0440\u0436\u0438 \u043a\u043e\u043b\u043e\u043d\u043d\u044b \u0442\u043e\u0441\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043e\u0440\u0434\u0435\u0440\u0430.  \u041a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432.    \u041e\u0431\u044a\u0435\u043c\u043d\u043e-\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u044f \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0431\u0430\u0448\u043d\u0438 \u0413\u043e\u0441\u0442\u0438\u043d\u043e\u0433\u043e \u0434\u0432\u043e\u0440\u0430 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438, \u0433\u0430\u0431\u0430\u0440\u0438\u0442\u044b \u043e\u0431\u044a\u0435\u043c\u043e\u0432, \u043a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u044e, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0430\u044f \u0441\u043e\u0431\u043e\u0439 \u0442\u0440\u0451\u0445\u044a\u044f\u0440\u0443\u0441\u043d\u044b\u0439, \u0441\u0442\u043e\u043b\u043f\u043e\u043e\u0431\u0440\u0430\u0437\u043d\u044b\u0439, \u043c\u043d\u043e\u0433\u043e\u0433\u0440\u0430\u043d\u043d\u044b\u0439 \u0432 \u043f\u043b\u0430\u043d\u0435 \u043e\u0431\u044a\u0435\u043c.  \u0417\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0438\u0435 \u0441\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0431\u0430\u0448\u043d\u0438 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f                       \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u043e\u0435 \u0432 \u0432\u0438\u0434\u0435 \u043c\u043d\u043e\u0433\u043e\u0433\u0440\u0430\u043d\u043d\u043e\u0433\u043e \u043a\u0443\u043f\u043e\u043b\u0430                                   \u0441 \u043a\u043e\u043d\u0443\u0441\u043e\u043e\u0431\u0440\u0430\u0437\u043d\u043e\u0439 \u043c\u0430\u043a\u043e\u0432\u043a\u043e\u0439, \u0438\u0445 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438, \u0433\u0430\u0431\u0430\u0440\u0438\u0442\u044b, \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0439.  \u041a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0438 \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e-\u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0435 \u0444\u0430\u0441\u0430\u0434\u043e\u0432 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430,                            \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u043c\u0435\u0441\u0442\u043e\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435, \u0444\u043e\u0440\u043c\u0430, \u0440\u0430\u0437\u043c\u0435\u0440 \u0438 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0435 \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432: \u0444\u0430\u0441\u0430\u0434\u044b \u0447\u043b\u0435\u043d\u044f\u0442\u0441\u044f \u043f\u0440\u043e\u0444\u0438\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u043c\u0438 \u043a\u0430\u0440\u043d\u0438\u0437\u0430\u043c\u0438 \u043d\u0430 \u0442\u0440\u0438 \u044f\u0440\u0443\u0441\u0430;                     \u0434\u0432\u0430 \u043d\u0438\u0436\u043d\u0438\u0445 \u044f\u0440\u0443\u0441\u0430 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u0430\u043d\u044b \u043a\u0432\u0430\u0434\u0440\u043e\u0432\u044b\u043c \u0440\u0443\u0441\u0442\u043e\u043c; \u0432 \u043f\u0435\u0440\u0432\u043e\u043c \u044f\u0440\u0443\u0441\u0435 \u0430\u0440\u043e\u0447\u043d\u044b\u0435 \u043f\u0440\u043e\u0451\u043c\u044b \u043e\u0431\u0440\u0430\u043c\u043b\u0435\u043d\u044b \u043f\u0440\u043e\u0444\u0438\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u043c\u0438 \u043d\u0430\u043b\u0438\u0447\u043d\u0438\u043a\u0430\u043c\u0438; \u0432\u0442\u043e\u0440\u043e\u0439 \u044f\u0440\u0443\u0441 \u043e\u043f\u043e\u044f\u0441\u0430\u043d \u043b\u043e\u0436\u043d\u044b\u043c\u0438 \u043c\u0430\u0448\u0438\u043a\u0443\u043b\u044f\u043c\u0438 \u0441 \u043f\u043e\u044f\u0441\u043e\u043c \u043f\u043e\u0440\u0435\u0431\u0440\u0438\u043a\u0430; \u0432 \u0432\u0435\u0440\u0445\u043d\u0435\u043c \u044f\u0440\u0443\u0441\u0435 \u043e\u043a\u043e\u043d\u043d\u044b\u0435 \u043f\u0440\u043e\u0435\u043c\u044b \u043f\u0440\u044f\u043c\u043e\u0443\u0433\u043e\u043b\u044c\u043d\u043e\u0439 \u0444\u043e\u0440\u043c\u044b.   \u041c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0438 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043e\u0442\u0434\u0435\u043b\u043a\u0438 \u0444\u0430\u0441\u0430\u0434\u043d\u044b\u0445 \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u0435\u0439 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0432\u043a\u043b\u044e\u0447\u0430\u044f, \u0441\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0435 \u0438\u0437 \u043a\u0438\u0440\u043f\u0438\u0447\u0430 \u0441\u0442\u0435\u043d\u044b \u043d\u0430 \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u043e\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438; \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u044b\u0435 \u0432 \u043a\u0438\u0440\u043f\u0438\u0447\u0435 \u0438 \u0448\u0442\u0443\u043a\u0430\u0442\u0443\u0440\u043a\u0435 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u044b \u0444\u0430\u0441\u0430\u0434\u043d\u043e\u0433\u043e \u0434\u0435\u043a\u043e\u0440\u0430.  \u041a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0444\u0430\u0441\u0430\u0434\u043e\u0432, \u043a\u0440\u043e\u0432\u0435\u043b\u044c.  \u041f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e-\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u043e\u0447\u043d\u0430\u044f \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0430 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432 \u0432 \u043f\u0440\u0435\u0434\u0435\u043b\u0430\u0445 \u043a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0445 \u0441\u0442\u0435\u043d, \u0441\u0442\u043e\u043b\u0431\u043e\u0432 \u0438 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u0438\u0439 \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0430\u044f \u0441\u043e\u0431\u043e\u0439 \u0432 \u043a\u0430\u0436\u0434\u043e\u043c \u044d\u0442\u0430\u0436\u0435 \u0435\u0434\u0438\u043d\u043e\u0435 \u043a\u0440\u0443\u0433\u043b\u043e\u0435 \u043f\u043e\u043c\u0435\u0449\u0435\u043d\u0438\u0435 \u0441\u043e \u0441\u0442\u043e\u043b\u0431\u043e\u043c \u0432 \u0446\u0435\u043d\u0442\u0440\u0435, \u0430 \u0442\u0430\u043a \u0436\u0435 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435, \u0444\u043e\u0440\u043c\u0430 \u0438 \u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432.   \u041a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0435 \u043a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0435 \u0441\u0442\u0435\u043d\u044b \u0438 \u0441\u0442\u043e\u043b\u0431\u044b \u043d\u0430 \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u043e\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438; \u043f\u043b\u043e\u0441\u043a\u0438\u0435 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u0438\u044f; \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u0430\u044f \u0432\u043d\u0443\u0442\u0440\u0438\u0441\u0442\u0435\u043d\u043d\u0430\u044f \u043b\u0435\u0441\u0442\u043d\u0438\u0446\u0430; \u0438\u0445 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 \u0438 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b, \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438 \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430.  \u0421\u0442\u043e\u043b\u044f\u0440\u043d\u044b\u0435 \u0437\u0430\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u044f \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432 \u0441\u043e \u0441\u043a\u043e\u0431\u044f\u043d\u044b\u043c \u043f\u0440\u0438\u0431\u043e\u0440\u043e\u043c, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u0438\u0445 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u044f, \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0438 \u043a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435                    \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430.  \u0421\u043a\u043e\u0431\u044f\u043d\u044b\u0435 \u0438\u0437\u0434\u0435\u043b\u0438\u044f \u043a\u043e\u043d\u0446\u0430 XVIII \u0432\u0435\u043a\u0430, \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0438 XIX \u0432\u0435\u043a\u0430, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u043c\u0435\u0442\u0430\u043b\u043b\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043f\u043e\u0434\u0441\u0442\u0430\u0432\u044b, \u043a\u043e\u0432\u0430\u043d\u044b\u0435 \u0437\u0430\u0442\u044f\u0436\u043a\u0438 \u0438 \u0441\u0432\u044f\u0437\u0438, \u043a\u043e\u0432\u0430\u043d\u044b\u0435 \u0440\u0435\u0448\u0435\u0442\u043a\u0438 \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432.   \u041a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432.    \u041e\u0431\u044a\u0435\u043c\u043d\u043e-\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u044f \u0432\u0438\u043d\u043d\u044b\u0445 \u0438 \u0441\u043e\u043b\u044f\u043d\u044b\u0445 \u0441\u043a\u043b\u0430\u0434\u043e\u0432 \u0413\u043e\u0441\u0442\u0438\u043d\u043e\u0433\u043e \u0434\u0432\u043e\u0440\u0430 \u043a\u043e\u043d\u0446\u0430 XVIII\u2013\u043d\u0430\u0447\u0430\u043b\u0430 XIX \u0432\u0435\u043a\u043e\u0432, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438, \u0433\u0430\u0431\u0430\u0440\u0438\u0442\u044b \u043e\u0431\u044a\u0435\u043c\u043e\u0432, \u043a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u044e, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0430\u044f \u0441\u043e\u0431\u043e\u0439 \u043e\u0434\u043d\u043e\u044d\u0442\u0430\u0436\u043d\u044b\u0439, \u043f\u0440\u044f\u043c\u043e\u0443\u0433\u043e\u043b\u044c\u043d\u044b\u0439 \u0432 \u043f\u043b\u0430\u043d\u0435 \u043e\u0431\u044a\u0435\u043c \u0441\u043e \u0441\u043a\u043e\u0448\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0439 \u0441\u0442\u0435\u043d\u043e\u0439.  \u0414\u0432\u0443\u0445\u0441\u043a\u0430\u0442\u043d\u0430\u044f \u043a\u0440\u044b\u0448\u0430 \u043a\u043e\u0440\u043f\u0443\u0441\u0430, \u0435\u0451 \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438, \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u044f, \u043a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u044f, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043a\u0440\u043e\u0432\u0435\u043b\u044c\u043d\u044b\u0445 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0439 \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVIII\u2013\u043d\u0430\u0447\u0430\u043b\u043e XIX \u0432\u0435\u043a\u043e\u0432.  \u041a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0438 \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e-\u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0435 \u0444\u0430\u0441\u0430\u0434\u043e\u0432 \u043a\u043e\u043d\u0446\u0430 XVIII\u2013\u043d\u0430\u0447\u0430\u043b\u0430 XIX \u0432\u0435\u043a\u043e\u0432, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u043c\u0435\u0441\u0442\u043e\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435, \u0444\u043e\u0440\u043c\u0430, \u0440\u0430\u0437\u043c\u0435\u0440 \u0438 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0435 \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432: \u043f\u0440\u043e\u0442\u044f\u0436\u0435\u043d\u043d\u044b\u0435 \u0441\u0435\u0432\u0435\u0440\u043d\u044b\u0439                   \u0438 \u044e\u0436\u043d\u044b\u0439 \u0444\u0430\u0441\u0430\u0434\u044b \u043d\u0435\u0440\u0430\u0432\u043d\u043e\u043c\u0435\u0440\u043d\u043e \u043f\u0440\u043e\u0440\u0435\u0437\u0430\u043d\u044b \u043f\u0440\u044f\u043c\u043e\u0443\u0433\u043e\u043b\u044c\u043d\u044b\u043c\u0438 \u0438 \u043b\u0443\u0447\u043a\u043e\u0432\u044b\u043c\u0438 \u043d\u0438\u0448\u0430\u043c\u0438 \u043e\u043a\u043e\u043d; \u0441\u0438\u043c\u043c\u0435\u0442\u0440\u0438\u0447\u043d\u044b\u0439 \u0442\u0440\u0435\u0445\u043e\u0441\u0435\u0432\u043e\u0439 \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u044b\u0439 \u0444\u0430\u0441\u0430\u0434 \u0438\u043c\u0435\u0435\u0442 \u043e\u043a\u043d\u0430                            \u0441 \u043b\u0443\u0447\u043a\u043e\u0432\u044b\u043c\u0438 \u043f\u0435\u0440\u0435\u043c\u044b\u0447\u043a\u0430\u043c\u0438; \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u043e\u0441\u044c \u043f\u043e\u0434\u0447\u0435\u0440\u043a\u043d\u0443\u0442\u0430 \u043b\u043e\u0436\u043d\u044b\u043c \u043f\u043e\u043b\u0443\u043a\u0440\u0443\u0433\u043b\u044b\u043c \u043e\u043a\u043d\u043e\u043c \u0432\u043e \u0444\u0440\u043e\u043d\u0442\u043e\u043d\u0435; \u0432\u0435\u043d\u0447\u0430\u044e\u0449\u0438\u0439 \u043a\u0430\u0440\u043d\u0438\u0437 \u0434\u0432\u0443\u0445\u043e\u0431\u043b\u043e\u043c\u043d\u044b\u0439.  \u041c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0438 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u043e\u0442\u0434\u0435\u043b\u043a\u0438 \u0444\u0430\u0441\u0430\u0434\u043d\u044b\u0445 \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u0435\u0439 \u043a\u043e\u043d\u0446\u0430                             XVIII\u2013\u043d\u0430\u0447\u0430\u043b\u0430 XIX \u0432\u0435\u043a\u043e\u0432, \u0432\u043a\u043b\u044e\u0447\u0430\u044f, \u0441\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0435 \u0438\u0437 \u043a\u0438\u0440\u043f\u0438\u0447\u0430 \u0441\u0442\u0435\u043d\u044b                                      \u043d\u0430 \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u043e\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438; \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u043d\u044b\u0435 \u0432 \u043a\u0438\u0440\u043f\u0438\u0447\u0435 \u0438 \u0448\u0442\u0443\u043a\u0430\u0442\u0443\u0440\u043a\u0435 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u044b \u0444\u0430\u0441\u0430\u0434\u043d\u043e\u0433\u043e \u0434\u0435\u043a\u043e\u0440\u0430.  \u041a\u043e\u043b\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0444\u0430\u0441\u0430\u0434\u043e\u0432, \u043a\u0440\u043e\u0432\u0435\u043b\u044c.  \u041f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e-\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u043e\u0447\u043d\u0430\u044f \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0430 \u0438\u043d\u0442\u0435\u0440\u044c\u0435\u0440\u043e\u0432 \u0432 \u043f\u0440\u0435\u0434\u0435\u043b\u0430\u0445 \u043a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0445 \u0441\u0442\u0435\u043d, \u0441\u0442\u043e\u043b\u0431\u043e\u0432 \u0438 \u043f\u0435\u0440\u0435\u043a\u0440\u044b\u0442\u0438\u0439 \u043a\u043e\u043d\u0446\u0430 XVIII\u2013\u043d\u0430\u0447\u0430\u043b\u0430 XIX \u0432\u0435\u043a\u043e\u0432, \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u043f\u0440\u043e\u0434\u043e\u043b\u044c\u043d\u044b\u043c \u043a\u043e\u0440\u0438\u0434\u043e\u0440\u043e\u043c, \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u044e\u0449\u0438\u043c\u0441\u044f \u043c\u043d\u043e\u0433\u043e\u0447\u0438\u0441\u043b\u0435\u043d\u043d\u044b\u043c\u0438, \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u043e \u0440\u0430\u0441\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u043c\u0438 \u043f\u0440\u043e\u0435\u043c\u0430\u043c\u0438 \u0432 \u0431\u043e\u043a\u043e\u0432\u044b\u0435 \u043f\u043e\u043c\u0435\u0449\u0435\u043d\u0438\u044f, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435, \u0444\u043e\u0440\u043c\u0430 \u0438 \u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432.   \u041a\u0430\u043f\u0438\u0442\u0430\u043b\u044c\u043d\u044b\u0435 \u043a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0435 \u0441\u0442\u0435\u043d\u044b \u0438 \u0441\u0442\u043e\u043b\u0431\u044b \u043d\u0430 \u0431\u0435\u043b\u043e\u043a\u0430\u043c\u0435\u043d\u043d\u043e\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438; \u043a\u0438\u0440\u043f\u0438\u0447\u043d\u044b\u0435 \u0430\u0440\u043a\u0438 \u0438 \u0441\u0432\u043e\u0434\u044b \u0441 \u0440\u0430\u0441\u043f\u0430\u043b\u0443\u0431\u043a\u0430\u043c\u0438; \u0432\u044b\u043c\u043e\u0449\u0435\u043d\u043d\u044b\u0439 \u043a\u0438\u0440\u043f\u0438\u0447\u043e\u043c \u00ab\u0432 \u0451\u043b\u043e\u0447\u043a\u0443\u00bb \u043f\u043e\u043b; \u0438\u0445 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 \u0438 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b, \u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0435 \u043e\u0442\u043c\u0435\u0442\u043a\u0438 \u043d\u0430 \u043a\u043e\u043d\u0435\u0446 XVIII\u2013\u043d\u0430\u0447\u0430\u043b\u043e XIX \u0432\u0435\u043a\u043e\u0432.  \u0421\u0442\u043e\u043b\u044f\u0440\u043d\u044b\u0435 \u0437\u0430\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u044f \u043e\u043a\u043e\u043d\u043d\u044b\u0445 \u0438 \u0434\u0432\u0435\u0440\u043d\u044b\u0445 \u043f\u0440\u043e\u0435\u043c\u043e\u0432 \u0441\u043e \u0441\u043a\u043e\u0431\u044f\u043d\u044b\u043c \u043f\u0440\u0438\u0431\u043e\u0440\u043e\u043c, \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \u0438\u0445 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d
